import './../App.css';
import {Link} from "react-router-dom";
import {UserContext} from "../Tech/UserContext";


function Client() {
    let state = UserContext.state;

    return (
        <div className="App">
            <header className="App-header">
                <h2>Client page</h2>
                <button className='Button-style' onClick={state = false}>
                    <Link to='/' className='Button-style' style={{textDecoration: 'none'}}>
                        Log Out
                    </Link>
                </button>
            </header>
        </div>
    );
}

export default Client;
